import React, { useState } from 'react';
import './Rooms.css'


export default function Arrays() {

  const [rooms, setRoom] = useState([{"name": "room1"}])

  const renderRooms = () => {
    return rooms.map((room) => {
       return (<div className="room"> {room.name}</div>);
    })
  }


  return (
    <div>{renderRooms()}</div>
  )

}
